import { useState } from "react";

function SEND ()  {
    const [name, setName] = useState("");
    const [code, setCode] = useState("");
    const [message, setMessage] = useState("");

    const postEvent = (e) => {
        e.preventDefault();
        const data = {
            name: name,
            code: code
        }
        const url = "https://testapi.photodino.de/cities/"
        fetch(url, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(data),
        })
        .then(response => {
            console.log("response", response);
            // eslint-disable-next-line eqeqeq
            if(response.ok){
                setName("")
            }
            }).catch(error =>{
                console.log('erreur', error)

            })
        }

        return(

                <form onSubmit={postEvent}>
                    <div class="mb-3 d-inline-block justify-content-center position-absolute top-25 start-50 translate-middle-x">
                        <label class="form-label" for="inputName">Name</label>
                        <input type="text" class="form-control" id="inputEmail" placeholder="Name"  value={name} required onChange={(e) => setName(e.target.value)}/>

                        <label class="form-label" for="inputCode">Code</label>
                        <input type="number" class="form-control" value={code} id="inputCode" placeholder="Code" required onChange={(e) => setCode(e.target.value)}/>

                        <div className="d-flex justify-content-center">
                            <button type="submit" class="btn btn-primary flex-">Create</button>
                        </div>

                    </div>

                </form>
        );
}

export default SEND;
